import React from "react";
import {BrowserRouter, NavLink} from 'react-router-dom';

const topTooltip = () => {
  return (
    <BrowserRouter>
    <ul className="shop__top-tooltip">
      <li><NavLink to="shop/all" activeClassName='is-active'><h2>all</h2></NavLink></li>
      <li><NavLink to="shop/rings"activeClassName='is-active'><h2>rings</h2></NavLink></li>
      <li><NavLink to="shop/necklaces" activeClassName='is-active'><h2>necklaces</h2></NavLink></li>
      <li><NavLink to="shop/bracelets" activeClassName='is-active'><h2>bracelets</h2></NavLink></li>
      <li><NavLink to="shop/earrings" activeClassName='is-active'><h2>earrings</h2></NavLink></li>
    </ul>
    </BrowserRouter>
  );
};

export default topTooltip;
